import React from "react";
import { Link } from "react-router-dom";
// import books from "../data/books";
import books from "../../data/books";
const Navbar = () => {
	return (
		<div className="navbar">
			{books.map((book) => (
				<Link to={`/book/${book.slug}`}>{book.title}</Link>
			))}
		</div>
	);
};
export default Navbar;
